// BoardItem.js

import React from "react";

const BoardItem = ({ title, content, time, views, comments }) => {
  return (
    <div className="board-item">
      <h2>{title}</h2>
      <p>{content}</p>
      <div className="metadata">
        <span>작성 시간: {time}</span>
        <span>조회수: {views}</span>
        <span>댓글 수: {comments}</span>
      </div>
    </div>
  );
};

export default BoardItem;
